    "2015-05-06T21:49:07.940185",nt"name": "lunar-health-monitor-project",nt"isopen":
    true,nt"url": null,nt"notes": "During the Phase II Lunar Health Monitor
    program, Orbital Research will develop a second generation wearable sensor suite
    for astronaut physiologic monitoring. The low profile system will be appropriate
    for both Extravehicular activities (EVA) and Intravehicular activities (IVA) monitoring
    scenarios. The EVA and IVA wearable platforms are capable of monitoring a complete
    physiologic profile of overall astronaut health status. Sensors of respiration,
    body temperature, acceleration and cardiac data are included. Inclusive in this
    sensor suite is Orbital's FDA cleared and patented dry recording electrodes. The
    sensors are held to the body via the garment and function without any tapes, adhesives
    or gels. The sensors are mechanically connected to the sensor suite. The mechanical
    connections allow sensors to be semi-permanently interfaced with either the EVA
    or IVA designs. These connectors allow sensors to be added, removed or replaced
    based on monitor application or anatomical constraints. The Lunar Health Monitor
    is designed to be continuously worn serving as a safety mechanism for out of vehicle
    exploration missions and a monitoring device for applications such as in orbit fitness
    assessment. The Lunar Health Monitor is easy to don and doff and non-encumbering
    to routine and functional tasks.",nt"license_title": "U.S. Government Work",nt"extras":
